import { Course } from "../../types";

export const CourseTable: React.FC<{ coursesList: Course[] }> = ({ coursesList }) => {
    return (
        <table>
            <thead>
                <tr>
                    <th>Course</th>
                    <th>ID</th>
                    <th>Price</th>
                    <th>Location</th>
                    <th>Dates</th>
                    <th>Link</th>
                </tr>
            </thead>
            <tbody>
                {coursesList.map(item => {
                    return (
                        <tr key={item.id}>
                            <td>{item.id}</td>
                            <td>{item.price}</td>
                            <td>{item.location}</td>
                            <td>{`${item.starts_at} - ${item.ends_at}`}</td>
                            <td>Register</td>
                        </tr>
                    );
                })}
            </tbody>
        </table>
    )
}
